                <span>aulani44342@gmail.com</span>
              </div>
              <div class="flex items-center">
                <i class="fas fa-phone mr-3 text-blue-300"></i>
                <span>+62 889 7682 0509</span>
              </div>
            </div>
            
            <div class="mt-6 w-full">
