      </div>
      
      <!-- Main Content -->
      <div class="lg:col-span-2 space-y-8">
        <!-- About Me -->
        <div class="card rounded-xl p-6 shadow-xl">
          <h2 class="text-2xl font-bold mb-4 flex items-center">
            <i class="fas fa-user mr-3 text-blue-400"></i>
            About Me
          </h2>
          <p class="opacity-90">
            Saya Muhammad Aulani, seorang web developer muda yang penuh semangat dan kreatif dari Tangerang. 
            Dengan passion di bidang teknologi dan desain, saya terus mengembangkan kemampuan untuk menciptakan 
            solusi digital yang menarik dan fungsional.
          </p>
          <p class="opacity-90 mt-3">
            Selain coding, saya menikmati fotografi, bermain game, dan menjelajahi teknologi terbaru. 
            Saya percaya bahwa kombinasi antara logika pemrograman dan kreativitas desain adalah kunci 
            untuk menciptakan produk digital yang luar biasa.
          </p>
        </div>
        
        <!-- Education -->
        <div class="card rounded-xl p-6 shadow-xl">
          <h2 class="text-2xl font-bold mb-6 flex items-center">
            <i class="fas fa-graduation-cap mr-3 text-blue-400"></i>
            Education History
          </h2>
          
          <div class="relative">
