                      minat di bidang sains dan komputer.
                    </p>
                  </div>
                </div>
              </div>
              
              <!-- SMP -->
              <div class="timeline-item relative">
                <div class="flex items-start">
                  <div class="bg-blue-500/20 rounded-lg p-4 flex-1">
                    <h3 class="font-bold text-lg">MTS Hidayaturrohman</h3>
